import React from "react";
/* import ContactCell from "./ContactCell"; */
import { Spin } from 'antd';
/* import { CSSTransition, TransitionGroup, } from 'react-transition-group';
import { connect } from "react-redux"; */

export const ModalSelectUsers = () => {
    const loading = (
        <div key={0} className="ct-chat-user-item">
          <Spin indicator={<div className="spinner-border" role="status">
                            <span className="sr-only">Loading...</span>
                            </div>
                        }
            size="large" />
                            
        </div>
      );
      const contacts = [], onContactSelect = [], selectedContacts = [];
                        
    return <body data-spy="scroll" data-target="#myScrollspy" data-offset="1">

    <div className="container-fluid">
      <div className="row">
        <nav className="col-sm-3 col-4" id="myScrollspy">
          <ul className="nav nav-pills flex-column">
            <li className="nav-item">
              <a className="nav-link active" href="#section1">Section 1</a>
            </li>
            ...
          </ul>
        </nav>
        <div className="col-sm-9 col-8">
          <div id="section1">
            <h1>Section 1</h1>
            <p>Try to scroll this page and look at the menu while scrolling!</p>
          </div>
          ...
        </div>
      </div>
    </div>
  
  </body>
}
